import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import { CardBasic } from "../Components/CardBasic";
import { IstabasAttels } from "../Components/IstabasAttels";
import bottom from "../Restes_bildes/balts.png";
import bottom_g from "../Restes_bildes/zals.png";

import k1 from "../Restes_bildes/kreisa1.png";
import k2 from "../Restes_bildes/kreisa2.png";
import k3 from "../Restes_bildes/kreisa_istaois_3.png";
import k4 from "../Restes_bildes/kreisa3.png";

import kl1 from "../Restes_bildes/kreisa_leja_2.png";
import kl2 from "../Restes_bildes/kreisa_leja_3.png";
import kl3 from "../Restes_bildes/kreisa_leja_4.png";
import kl4 from "../Restes_bildes/kreisa_leja_5.png";
import kl5 from "../Restes_bildes/3stavs/kreisa_leja_pedejais.png";
import kl6 from "../Restes_bildes/3stavs/kreisa_apaksa_small.png";

export const Floor = () => {
  const param = useParams();
  const { id } = param;
  useEffect(() => {
    // api call
    console.log("also i call something to python");
    console.log(id);
  }, [id]);

  const styleProps = {
    position: "absolute",
    transform: "scale(0.7)",
  };
  return (
    <>
      <div style={{ textSizeAdjust: "2rem" }}>This is Floor {id} plan</div>
      <CardBasic>
        <IstabasAttels
          alt={"logo1"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{ ...styleProps, left: 425, top: 300 }}
        />
        {/* <img style={{ position: "absolute", left: 425,top:300, transform: 'scale(0.7)'}} onmouseover={()=>hover(,{bottom_g})} onmouseout="unhover(this);" src={bottom} alt="Logo1" /> */}
        <img
          style={{
            position: "absolute",
            left: 495,
            top: 300,
            transform: "scale(0.7)",
          }}
          onMouseOver="hover(this,bottom_g);"
          onMouseOut="unhover(this);"
          src={bottom}
          alt="Logo2"
        />
        <img
          style={{
            position: "absolute",
            left: 565,
            top: 300,
            transform: "scale(0.7)",
          }}
          onmouseover="hover(this,bottom_g);"
          onmouseout="unhover(this);"
          src={bottom}
          alt="Logo3"
        />
        <img
          style={{
            position: "absolute",
            left: 635,
            top: 300,
            transform: "scale(0.7)",
          }}
          onmouseover="hover(this,bottom_g);"
          onmouseout="unhover(this);"
          src={bottom}
          alt="Logo4"
        />
        <img
          style={{
            position: "absolute",
            left: 705,
            top: 300,
            transform: "scale(0.7)",
          }}
          onmouseover="hover(this,bottom_g);"
          onmouseout="unhover(this);"
          src={bottom}
          alt="Logo5"
        />
        <img
          style={{
            position: "absolute",
            left: 775,
            top: 300,
            transform: "scale(0.7)",
          }}
          onmouseover="hover(this,bottom_g);"
          onmouseout="unhover(this);"
          src={bottom}
          alt="Logo6"
        />
        <img
          style={{
            position: "absolute",
            left: 845,
            top: 300,
            transform: "scale(0.7)",
          }}
          onmouseover="hover(this,bottom_g);"
          onmouseout="unhover(this);"
          src={bottom}
          alt="Logo7"
        />
        <img
          style={{
            position: "absolute",
            left: 915,
            top: 300,
            transform: "scale(0.7)",
          }}
          onmouseover="hover(this,bottom_g);"
          onmouseout="unhover(this);"
          src={bottom}
          alt="Logo8"
        />
        <img
          style={{
            position: "absolute",
            left: 985,
            top: 300,
            transform: "scale(0.7)",
          }}
          onmouseover="hover(this,bottom_g);"
          onmouseout="unhover(this);"
          src={bottom}
          alt="Logo9"
        />
        <img
          style={{
            position: "absolute",
            left: 1055,
            top: 300,
            transform: "scale(0.7)",
          }}
          onmouseover="hover(this),bottom_g;"
          onmouseout="unhover(this);"
          src={bottom}
          alt="Logo10"
        />

        <img
          style={{
            position: "absolute",
            left: 645,
            top: 200,
            transform: "scale(1)",
          }}
          src={k1}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo11"
        />
        <img
          style={{
            position: "absolute",
            left: 615,
            top: 200,
            transform: "scale(1)",
          }}
          src={k2}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo12"
        />
        <img
          style={{
            position: "absolute",
            left: 542,
            top: 200,
            transform: "scale(1)",
          }}
          src={k3}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo13"
        />
        <img
          style={{
            position: "absolute",
            left: 440,
            top: 200,
            transform: "scale(1)",
          }}
          src={k4}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo14"
        />

        <img
          style={{
            position: "absolute",
            left: 378,
            top: 257,
            transform: "scale(1)",
          }}
          src={kl1}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo15"
        />
        <img
          style={{
            position: "absolute",
            left: 330,
            top: 262,
            transform: "scale(1)",
          }}
          src={kl2}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo16"
        />
        <img
          style={{
            position: "absolute",
            left: 293,
            top: 262,
            transform: "scale(1)",
          }}
          src={kl3}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo17"
        />
        <img
          style={{
            position: "absolute",
            left: 220,
            top: 262,
            transform: "scale(1)",
          }}
          src={kl4}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo18"
        />
        <img
          style={{
            position: "absolute",
            left: 156,
            top: 250,
            transform: "scale(1)",
          }}
          src={kl5}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo19"
        />
        <img
          style={{
            position: "absolute",
            left: 194,
            top: 250,
            transform: "scale(1)",
          }}
          src={kl6}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo20"
        />
      </CardBasic>
    </>
  );
};
